import React from "react";
import { useEffect } from "react";
import { useState } from "react";

function Note() {
  const [records , setRecords] = useState([])

  useEffect(()=>{
    fetch('http://localhost:8080/user')
    .then(response => response.json())
    .then(data => setRecords(data))
    .catch(err => console.log(err))
  }, []);

  const [pc,setPc] = useState(false);
  const [browser,setBrowser] = useState(false);

  const handleChange=(data)=>{
    if(data=="pc"){
      setPc(!pc);
    }
    if(data=="browser"){
      setBrowser(!browser);
    }
  }
  return (
    <div>
      <div className="row">
      <div><input type="checkbox" value={pc} onChange={()=>handleChange("pc")} /> Option 1 </div>
      <div><input type="checkbox" value={browser} onChange={()=>handleChange("browser")} /> Option 2 </div>
      <div><input type="checkbox" value={browser} onChange={()=>handleChange("browser")} /> Option 3 </div>
      <div><input type="checkbox" value={browser} onChange={()=>handleChange("browser")} /> Option 3 </div>
      <div><input type="checkbox" value={browser} onChange={()=>handleChange("browser")} /> Option 4 </div>
      </div>

      <table className="border table table-striped table table-bordered">
        <thead className="border thead-dark">
        <tr>
        <th scope="col">First name</th>
        <th scope="col">Last Name</th>
        <th scope="col">Email</th>
        <th scope="col">Gender</th>
        <th scope="col">Income</th>
        <th scope="col">City</th>
        <th scope="col">Car</th>
        <th scope="col">Quote</th>
        <th scope="col">Phone Price</th>
        </tr>
        </thead>

        {records.filter((list)=> {




        }).map((list,index)=> (

          <tbody className="border">
          <tr>
          <th scope="col">{list.first_name}</th>
          <th scope="col">{list.last_name}</th>
          <th scope="col">{list.email}</th>
          <th scope="col">{list.gender}</th>
          <th scope="col">{list.income}</th>
          <th scope="col">{list.city}</th>
          <th scope="col">{list.car}</th>
          <th scope="col">{list.quote}</th>
          <th scope="col">{list.phone_price}</th>
          </tr>
          </tbody>
        ))}
      </table>
    </div>
  );
}

export default Note;
